  excludeLinksFromLockfile: false

importers:

  .:
    dependencies:
      validations-br:
        specifier: file:..
        version: file:..

packages:

  validations-br@file:..:
    resolution: {directory: .., type: directory}

snapshots:

  validations-br@file:..: {}
